settings\u0004Note: To disable a context:
Not: İçerik menüsü öğesini devre dışı bırakmak için,
Kullanıcı Tercihlerine kopyalayın ve  'disabled' anahtar kelimesini ekleyin. 
Aşağıda bulunan örnek dosyalarda Download(İndirme) öğesini devre dışı bırakacaktır:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

